// Função para consultar a API e obter a celebração litúrgica
async function getCelebracaoLiturgica(data) {
    const resposta = await fetch(`https://liturgia.up.railway.app/${data}`);
    const dados = await resposta.json();
    return dados.liturgia; // Supondo que a resposta contenha a propriedade "celebracao"
}

function getDomingos(mes, ano) {
    const domingos = [];
    const data = new Date(ano, mes, 1);
    let diaSemana = data.getDay();
    let primeiroDomingo = diaSemana === 0 ? 1 : 7 - diaSemana + 1;
    let domingo = new Date(ano, mes, primeiroDomingo);
    
    while (domingo.getMonth() === mes) {
        domingos.push(new Date(domingo));
        domingo.setDate(domingo.getDate() + 7);
    }
    
    return domingos;
}

async function gerarPDF() {
    const { jsPDF } = window.jspdf;
    const doc = new jsPDF();
    
    // Capturar os dados do formulário
    const mesSelecionado = document.getElementById("meses").value;
    
    // Adicionar conteúdo ao PDF
    var img = new Image()
    img.src = "data:image/jpeg;base64,"
    img.onload = async function() {
        var larguraPagina = doc.internal.pageSize.width; 
        doc.line(0, 40, larguraPagina, 40);
        doc.setFont("helvetica", "bold");
        
        // Definindo as propriedades da imagem
        var larguraImagem = 30;
        var alturaImagem = 30;
        var espacoEntreImagemETitulo = 10; // Espaço entre a imagem e o título
        
        // Texto ao lado da imagem
        var texto = "Ministros Extraordinários da Sagrada Comunhão";
        var data = `Escala ${mesSelecionado}/2025`;
        
        // Calculando as posições para centralizar a imagem e o texto
        var larguraTexto = doc.getTextWidth(texto); // Largura do texto principal
        var larguraData = doc.getTextWidth(data); // Largura do texto da data
        var larguraCombinada = larguraImagem + larguraTexto + espacoEntreImagemETitulo; // Largura total combinada
        var posXImagem = (larguraPagina - larguraCombinada) / 2; // Posição X para centralizar a combinação de imagem e texto
        var posYImagem = 5; // Posição Y da imagem
        var posXTexto = posXImagem + larguraImagem + espacoEntreImagemETitulo; // Posição X do texto (à direita da imagem)
        var posYTexto = posYImagem + alturaImagem / 2 - 2; // Posição Y do texto principal (alinhado ao centro da imagem)
        
        // Ajuste da posição X para a data
        var posXData = (posXImagem + larguraImagem + larguraTexto + posXTexto - larguraData) / 2; // Ajusta a posição X da data para centralizar
        var posYData = posYTexto + 10; // Posição Y da data (abaixo do texto principal)
        
        // Adicionando a imagem
        doc.addImage(img, 'PNG', posXImagem, posYImagem, larguraImagem, alturaImagem);
        
        // Adicionando o texto principal ao lado da imagem
        doc.text(texto, posXTexto, posYTexto);
        
        // Adicionando o texto da data abaixo e centralizado em relação à combinação de imagem e texto
        doc.text(data, posXData, posYData);        
        
        // Adiciona o texto centralizado
        doc.setFont("helvetica", "normal");

        if (!mesSelecionado) {
            alert("Por favor, selecione um mês.");
            return;
        }

        const meses = {
            Janeiro: 0, Fevereiro: 1, Março: 2, Abril: 3, Maio: 4, Junho: 5,
            Julho: 6, Agosto: 7, Setembro: 8, Outubro: 9, Novembro: 10, Dezembro: 11
        };

        const anoAtual = new Date().getFullYear();
        const mes = meses[mesSelecionado];
        const domingos = getDomingos(mes, anoAtual);
        
        let ministrosPorHorario = {
            "7:00": [],
            "9:00": [],
            "19:30": []
        };
        
        // Passo 1: Mapear preferências dos ministros
        ministros.forEach(ministro => {
            ministro.preferencias.forEach(horario => {
                ministrosPorHorario[horario].push(ministro.nome);
            });
        });

        function distribuirEscalaRotativa(domingos, ministrosPorHorario, casais) {
            let distribuicao = [];
            let historicoEscalas = {}; // Para armazenar quais ministros já foram escalados para cada domingo
            let contadorEscalas = {}; // Para contar quantas vezes cada ministro foi escalado
            
            // Inicializa o contador de escalas para cada ministro
            Object.values(ministrosPorHorario).forEach(horario => {
                horario.forEach(ministro => {
                    contadorEscalas[ministro] = 0;
                });
            });
        
            function embaralhar(array) {
                for (let i = array.length - 1; i > 0; i--) {
                    const j = Math.floor(Math.random() * (i + 1));
                    [array[i], array[j]] = [array[j], array[i]]; // Troca os elementos
                }
            }
        
            // Cria um objeto de casais para fácil acesso
            let casaisMap = new Map();
            casais.forEach(casal => {
                casaisMap.set(casal[0], casal[1]);
                casaisMap.set(casal[1], casal[0]);
            });
        
            domingos.forEach((domingo, index) => {
                let distribuido = {
                    "7:00": [],
                    "9:00": [],
                    "19:30": []
                };
        
                // Para cada horário, distribuímos os ministros de forma equilibrada
                Object.keys(ministrosPorHorario).forEach(horario => {
                    let ministros = [...ministrosPorHorario[horario]]; // Copiar a lista de ministros
                    
                    embaralhar(ministros);
        
                    // Ordenar ministros por quantidade de escalas (menor número de escalas primeiro)
                    ministros = ministros.sort((a, b) => contadorEscalas[a] - contadorEscalas[b]);
        
                    // Selecionar até 6 ministros para o horário, garantindo que nenhum repita no mesmo domingo
                    for (let i = 0; i < 6 && ministros.length > 0; i++) {
                        let ministroEscolhido = ministros.shift(); // Pega o ministro com menos escalas
                        if (!historicoEscalas[domingo]) {
                            historicoEscalas[domingo] = new Set(); // Se ainda não existia, inicializa o Set
                        }
        
                        // Garantir que o ministro não seja escalado no mesmo domingo
                        while (historicoEscalas[domingo].has(ministroEscolhido)) {
                            ministroEscolhido = ministros.shift(); // Pega outro ministro
                            if (ministros.length === 0) break;
                        }
        
                        // Verificar se o ministro é parte de um casal
                        if (casaisMap.has(ministroEscolhido)) {
                            let parceiro = casaisMap.get(ministroEscolhido);
                            if (!historicoEscalas[domingo].has(parceiro)) {
                                // Se ambos os ministros do casal ainda não foram escalados, escalá-los juntos
                                distribuido[horario].push(ministroEscolhido);
                                distribuido[horario].push(parceiro);
                                historicoEscalas[domingo].add(ministroEscolhido);
                                historicoEscalas[domingo].add(parceiro);
                                contadorEscalas[ministroEscolhido]++;
                                contadorEscalas[parceiro]++;
                            }
                        } else {
                            // Caso o ministro não seja parte de um casal, escalar apenas ele
                            if (ministroEscolhido) {
                                distribuido[horario].push(ministroEscolhido);
                                historicoEscalas[domingo].add(ministroEscolhido); // Marca como escalado
                                contadorEscalas[ministroEscolhido]++; // Incrementa a contagem de escalas
                            }
                        }
        
                        if (distribuido[horario].length >= 6) {
                            break; // Já temos 6 ministros para esse horário
                        }
                    }
                });
        
                distribuicao.push(distribuido);
            });
        
            return distribuicao;
        }
        
        let casais = [
            ["Carlos Magno", "Giselda"], 
            // ...
        ];
        
        let distribuicaoFinal = distribuirEscalaRotativa(domingos, ministrosPorHorario, casais);
        
        let yPos = 50; 
        const maxY = 280;

        // Exibe os dados no PDF
        for (let domingoIndex = 0; domingoIndex < distribuicaoFinal.length; domingoIndex++) {
            const escalaDomingo = distribuicaoFinal[domingoIndex];
        
            // Verifica se o yPos ultrapassou o limite da página, se sim, adiciona uma nova página
            if (yPos + 10 > maxY) {
                doc.addPage();
                yPos = 20;
            }
        
            // Adiciona o título do domingo
            doc.setFont("helvetica", "bold");
        
            // Espera a resposta da API para obter a celebração
            const celebracao = await getCelebracaoLiturgica((domingos[domingoIndex].toLocaleDateString('pt-BR')).replace(/\//g, '-'));
            let texto = ""
            
            if(!celebracao) {
                texto = `${domingos[domingoIndex].toLocaleDateString('pt-BR')}:`;
            }
            else {
                texto = `${domingos[domingoIndex].toLocaleDateString('pt-BR')} - ${celebracao}:`;
            }
            
            // Adiciona o texto ao PDF
            doc.text(texto, 10, yPos);
            yPos += 10;
        
            // Prepara os dados para a tabela
            const tabelaDados = Object.keys(escalaDomingo).map(horario => {
                return [horario, escalaDomingo[horario].join(', ')];
            });
        
            // Gera a tabela com os dados
            doc.autoTable({
                startY: yPos,
                head: [['Horário', 'Ministros']],
                body: tabelaDados,
                theme: 'grid', // Estilo da tabela (grid, plain, strip)
                styles: {
                    font: 'helvetica',
                    fontSize: 10,
                    halign: 'center', // Centraliza o texto na tabela
                    cellPadding: 2
                },
                headStyles: {
                    fillColor: [90, 90, 90], // Cor do cabeçalho (cinza mais escuro)
                    halign: 'center' // Centraliza o texto no cabeçalho
                },
            });
        
            // Atualiza yPos para a próxima entrada
            yPos = doc.lastAutoTable.finalY + 10;
        
            // Linha divisória entre domingos
            doc.line(0, yPos, larguraPagina, yPos);
            yPos += 10;
        }        

        function calcularEscalas(distribuicao) {
            // Criar um objeto para armazenar as contagens de escalas por ministro
            let contadorEscalas = {};
        
            // Percorrer a distribuição e contar as escalas de cada ministro
            distribuicao.forEach(dia => {
                Object.keys(dia).forEach(horario => {
                    dia[horario].forEach(ministro => {
                        // Se o ministro já foi escalado, incrementar o contador
                        if (contadorEscalas[ministro]) {
                            contadorEscalas[ministro]++;
                        } else {
                            // Caso contrário, inicializar o contador para esse ministro
                            contadorEscalas[ministro] = 1;
                        }
                    });
                });
            });
        
            return contadorEscalas;
        }
               
        let resultado = calcularEscalas(distribuicaoFinal);
        console.log(resultado);        
        
        // Baixar o PDF
        doc.save(`Escala_Ministros_${mesSelecionado}/${anoAtual}.pdf`);
    }
  }